DROP TABLE IF EXISTS `sys_login_log`;

CREATE TABLE `sys_login_log` (
  `id` varchar(100) NOT NULL COMMENT '主键',
  `username` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '登录账号',
  `login_ip` varchar(100) DEFAULT NULL COMMENT '登录IP',
  `browser` varchar(100) DEFAULT NULL COMMENT '浏览器',
  `os` varchar(100) DEFAULT NULL COMMENT '操作系统',
  `status` int DEFAULT '0' COMMENT '登录状态 1成功0失败',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `msg` varchar(255) DEFAULT NULL COMMENT '登录信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

