/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` varchar(40) NOT NULL COMMENT '主键',
  `username` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '登录账号',
  `password` varchar(40) DEFAULT NULL COMMENT '密码',
  `password_level` int DEFAULT '0' COMMENT '密码强度0初始 1很弱 2弱 3安全 4很安全',
  `password_time` datetime DEFAULT NULL COMMENT '密码重置时间',
  `password_status` int DEFAULT '0' COMMENT '密码重置状态0正常，1重置',
  `salt` varchar(100) DEFAULT NULL COMMENT '密码种子',
  `nickname` varchar(40) DEFAULT NULL COMMENT '用户名称',
  `email` varchar(40) DEFAULT NULL COMMENT '电子邮箱',
  `mobile` varchar(40) DEFAULT NULL COMMENT '手机号码',
  `icon` varchar(100) DEFAULT NULL COMMENT '头像地址',
  `status` int DEFAULT '1' COMMENT '用户状态，0禁用，1启用',
  `fail_num` int DEFAULT '0' COMMENT '连续登录失败次数',
  `last_fail_time` datetime DEFAULT NULL COMMENT '最近登录失败时间',
  `last_login_time` datetime DEFAULT NULL COMMENT '最近登录时间',
  `last_login_ip` varchar(100) DEFAULT NULL COMMENT '最近登录ip',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(100) DEFAULT NULL COMMENT '创建者账号',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(100) DEFAULT NULL COMMENT '更新者账号',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

